tables.table_schema:
CREATE TABLE circuits (
    circuit_id INT PRIMARY KEY,
    circuit_name VARCHAR(255) NOT NULL,
    configuration JSONB
);

CREATE TABLE simulations (
    simulation_id INT PRIMARY KEY,
    simulation_name VARCHAR(255) NOT NULL,
    circuit_id INT,
    FOREIGN KEY (circuit_id) REFERENCES circuits(circuit_id)
);

CREATE TABLE CircuitDesigns (
  circuit_id INT PRIMARY KEY,
  circuit_name VARCHAR(255),
  quantum_gates TEXT
);

CREATE TABLE CircuitConfigurations (
  configuration_id INT PRIMARY KEY,
  circuit_id INT,
  gate_parameters JSON,
  FOREIGN KEY (circuit_id) REFERENCES CircuitDesigns(circuit_id)
);

CREATE TABLE QuantumResults (
  result_id INT PRIMARY KEY,
  circuit_id INT,
  simulation_result TEXT,
  FOREIGN KEY (circuit_id) REFERENCES CircuitDesigns(circuit_id)
);

CREATE TABLE circuits (
    circuit_id SERIAL PRIMARY KEY,
    circuit_name VARCHAR(255) NOT NULL,
    circuit_description TEXT
);

CREATE TABLE qubits (
    qubit_id SERIAL PRIMARY KEY,
    qubit_name VARCHAR(255) NOT NULL,
    qubit_type VARCHAR(50) NOT NULL
);

CREATE TABLE gates (
    gate_id SERIAL PRIMARY KEY,
    gate_name VARCHAR(255) NOT NULL,
    gate_operation VARCHAR(50) NOT NULL,
    gate_matrix TEXT
);

CREATE TABLE CircuitDesigns (
    circuit_id SERIAL PRIMARY KEY,
    circuit_name VARCHAR(50) NOT NULL,
    circuit_description TEXT,
    created_date TIMESTAMP
);

CREATE TABLE CircuitComponents (
    component_id SERIAL PRIMARY KEY,
    component_name VARCHAR(50) NOT NULL,
    component_type VARCHAR(50),
    component_description TEXT
);

CREATE TABLE QuantumSimulations (
    simulation_id SERIAL PRIMARY KEY,
    simulation_name VARCHAR(50) NOT NULL,
    simulation_description TEXT,
    simulation_date TIMESTAMP
);

CREATE TABLE SimulationResults (
    result_id SERIAL PRIMARY KEY,
    simulation_id INT REFERENCES QuantumSimulations(simulation_id),
    result_data JSON,
    result_timestamp TIMESTAMP
);

CREATE TABLE SimulationParticipants (
    participant_id SERIAL PRIMARY KEY,
    participant_name VARCHAR(50) NOT NULL,
    participant_role VARCHAR(50),
    participant_email VARCHAR(100)
);
